        localStorage.setItem('type',type)
        router.push("/page.shop")
        return null;
    }

    useEffect(() => {
        localStorage.clear();
    }, [])

    return (
      <FormItem style={{margin:"0px"}}>
            <Card style={{ width: 300 }}>
    <p>Card content</p>
    <p>Card content</p>
    <p>Card content</p>
  </Card>,
      </FormItem>
    )
}

